<p>理想中的留学回国，好像是地面的水，化气升上天空，又变雨回到地面，一世的人都望着、说着。现在万里回乡，祖国的人海里，泡沫也没起一个——不承那王主任笔下吹嘘，自己也被吹成一个大泡泡，未破时五光十色，经不起人一搠就不知去向。</p>
