<p>right now, if you are a beginner, you may feel that the conversation is one-sided, that you have to listen more than you can speak because you have little to contribute. if you are a student, you may feel that you have only one reader: you teacher. all that may be true, for the moment. but at some point, you will join a conversation that, at its best, can help you and your community free us from ignorance, prejudice, and then half-baked ideas that so many charlatans try to impose on us. it is no exaggeration to say that, maybe not today or tomorrow but one day, the research you do and the arguments you make using it can improve if not the whole world, then at least you corner of it.</p>
